    imgUrl = 'images/berlin.jpg'
    render() {
        return (
            <div className = "background" floated = "left" style = {{backgroundColor:"red"}}>
                Login Page
                <Header as="h2" floated = "left">
                    Login
                </Header>
            </div>
        );
    }
}

export default Login;
